import './App.css';
import {AuthContextProvider} from "./context/AuthContext";
import {AppRouter} from "./AppRouter";
import {OrderContextProvider} from "./context/OrderContext";

function App() {
    return (
        <AuthContextProvider>
            <OrderContextProvider>
                <AppRouter/>
            </OrderContextProvider>
        </AuthContextProvider>
    );
}

export default App;
